import { Button, TextField, Dialog, DialogActions, DialogContent, 
    DialogTitle, DialogContentText } from '@material-ui/core';
import CreateAccount from './CreateAccount';

import React from 'react';

type Props = {
    openSignIn: boolean;
    handleCloseSignIn: () => void;
}

const SignIn: React.FC<Props> = ({openSignIn, handleCloseSignIn}: Props) => {
    const [openCreateAccount, setOpenCreateAccount] = React.useState<boolean>(false);

    const handleClickOpenCreateAccount = () => {
      setOpenCreateAccount(true);
    };

    const handleCloseCreateAccount = () => {
      setOpenCreateAccount(false);
    };


    return (
        <Dialog open={openSignIn} onClose={handleCloseSignIn} fullWidth>
            <DialogTitle>Welcome Back!</DialogTitle>
            <DialogContent>
                <DialogContentText>
                    Sign in to create threads, comment and more...
                </DialogContentText>
                <DialogContentText>
                    Dont have an account? Create one to do much more!
                </DialogContentText>
                <TextField
                    autoFocus
                    type='text'
                    margin="normal"
                    label="Username"
                    fullWidth
                    variant="outlined"
                />
                <TextField
                    type='password'
                    margin="normal"
                    label="Password"
                    fullWidth
                    variant="outlined"
                />
            </DialogContent>
            <DialogActions>
                <Button onClick={handleClickOpenCreateAccount}>Create Account</Button>
                <Button onClick={handleCloseSignIn}>Cancel</Button>
                <Button onClick={handleCloseSignIn}>Sign In</Button>
                <CreateAccount openCreateAccount={openCreateAccount} handleCloseCreateAccount={handleCloseCreateAccount}/>
            </DialogActions>
        </Dialog>
    );
};

export default SignIn;
